body {
  position: relative; }
  body::before {
    content: "";
    display: block;
    height: 100vh;
    width: 100vw;
    background-color: rgba(0, 0, 0, 0.6);
    position: fixed;
    top: 0;
    left: 0;
    transition: all 0.5s ease;
    transition-delay: 0.25s;
    opacity: 0;
    visibility: hidden;
    z-index: 0; }

/**
 * Wrapping element to keep content contained and centered.
 */
.l-wrap {
  position: relative;
  width: 100%;
  margin-left: auto;
  margin-right: auto;
  padding-left: 20px;
  padding-right: 20px; }
  @media (min-width: 1001px) {
    .l-wrap {
      padding-left: 40px;
      padding-right: 40px; } }

/**
 * Layout containers - keep content centered and within a maximum width. Also
 * adjusts left and right padding as the viewport widens.
 */
.l-container {
  position: relative;
  width: 100%;
  margin-left: auto;
  margin-right: auto;
  max-width: 1200px; }
  .l-container--s {
