  border-collapse: collapse;
  border-radius: 8px;
  padding: 0;
  width: 100%;
  border: 0;
}

.o-table--responsive thead {
  border: none;
  clip: rect(0 0 0 0);
  height: 1px;
  margin: -1px;
  overflow: hidden;
  padding: 0;
  position: absolute;
  width: 1px;
}

.o-table--responsive tr {
  display: block;
  margin-bottom: 10px;
  border: 1px solid #adadad;
  border-radius: 8px;
  overflow: hidden;
  background: white;
  box-shadow: 0px 4px 12px rgba(0, 0, 0, 0.05);
  transition: all 0.4s cubic-bezier(0.86, 0, 0.07, 1);
