/**
 * Drawer menu
 */
body.menu-is-active {
  overflow: hidden;

  &::before {
    opacity: 1;
    visibility: visible;
    z-index: 9998;

    @include media(">xlarge") {
      opacity: 0;
      visibility: hidden;
    }
  }

  .c-nav-drawer {
    right: 0;
  }
}

.c-nav-drawer {
  display: flex;
  flex-direction: column;
  justify-content: space-between;
  width: 100vw;
  height: 100vh;
  background-color: $c-white;
  position: fixed;
  z-index: 9999;
  top: 0;
  right: -100vw;
  transition: right 0.25s $transition-effect;

  @include media(">small") {
    width: 100%;
    max-width: 400px;
    right: -400px;
  }

  @include media(">xlarge") {
    display: none;
  }

  &__toggle {
    background-color: transparent;
    justify-content: flex-start;
    padding: $space;
    outline: 0;
    border: 0;
    border-radius: 0;
    background-image: none;

    .o-icon {
      transition: transform 0.25s $transition-effect;
      transform: scale(1);
    }

    &:hover,
    &:focus {
      .o-icon {
        transform: scale(1.1);
      }
    }
  }

  &__nav {
    height: 100%;
    padding-top: $space-double;
  }

  &__social {
    border-top: $border--standard-light;

    .c-social-links {
      justify-content: space-evenly;

      &__item {
        border: 0;
        border-radius: 0;
        background: none;
        margin: 0;

        svg path {
          fill: $c-gray--light;
        }

        &:hover,
        &:focus {
          svg path {
            fill: $c-primary;
          }
        }
      }
    }
  }
}

/**
 * Primary nav
 */
.c-nav-primary {
  &__menu-item {
    margin: 0 $space-double;

    @include media(">xlarge") {
      margin: 0 $space;

      &:last-child {
        margin-right: 0;
      }
    }
  }

  &__list {
    display: flex;
    flex-direction: column;
    align-items: stretch;
    justify-content: flex-start;

    @include media(">xlarge") {
      flex-direction: row;
      align-items: center;
      justify-content: flex-end;
    }
  }

  &__menu-item:not(.button) a {
    width: 100%;
    padding: $space 0;
    border-bottom: $border--standard-light;
    color: $c-black;
    display: flex;
    align-items: center;
    justify-content: space-between;

    @include o-heading--s;

    @include media(">xlarge") {
      width: 100%;
      padding: $space-quarter 0;
      display: flex;
      align-items: center;
      justify-content: space-between;
      color: $c-black;
      border-bottom: 1px solid transparent;
      text-align: center;
    }

    &:hover,
    &:focus {
      color: $c-black;

      @include media(">xlarge") {
        border-bottom: 1px solid $c-black;
      }


      &::after {
        opacity: 1;
        visibility: visible;
        left: 0;
      }
    }

    &::after {
      opacity: 0;
      visibility: hidden;
      content: "";
