/**
 * Utility nav
 */
.c-nav-utility {
  display: flex;
  flex-direction: column;
  align-items: stretch;
  justify-content: stretch;
  margin: $space-double;

  @include media(">medium") {
    flex-direction: row;
    align-items: center;
    justify-content: flex-end;
    margin: 0 (-$space-half);
  }


  &__link {
    @include o-heading--xs;

    color: $c-primary;
    padding: $space-half 0;
    position: relative;

    @include media(">medium") {
      color: $c-white;
      padding: 0 $space-half;
      height: 100%;
      line-height: 40px;
    }


    &:hover,
    &:focus {
      color: $c-black;

      @include media(">medium") {
        color: $c-white;

        &::after {
          background-color: $c-secondary;
        }
      }
    }

    &::after {
      content: "";
      display: block;
      width: 100%;
      height: 100%;
      background-color: transparent;
      position: absolute;
      top: 0;
      left: 0;
      z-index: -1;
      transform: skewX(-20deg);
      transition: $transition-all;
      pointer-events: none;
